import './styles/App.css';
import logo from './logo.png';

function App() {
  return (
    <div className="bg-[#efefef]">
      <header>
        <div className="gap-x-[1.75rem] gap-y-[1.75rem] flex-row justify-between items-center pt-[2rem] pb-[2rem] flex">
          <img src={logo} alt="Logo" className="pl-[10px] pr-0 py-0" />
          <div className="gap-x-[1rem] gap-y-[1rem] justify-end items-center w-full flex">
            <div className="gap-x-[.8rem] gap-y-[.8rem] items-center flex">
              <a href="" className="text-[#151515]  items-center px-[.75rem]  no-underline [transition:all_.25s] flex">Portfolio</a>
              <a href="" className="text-[#151515]  items-center px-[.75rem]  no-underline [transition:all_.25s] flex">Contact</a>
            </div>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
